    return of(response).pipe(
      delay(2000),
      tap((response) => {
        // if log in is successful, sets current user
        if (response.success) {
          this.userService.setCurrentUser(response.data);
        }
      })
    );
  }

  logOut() {
    this.userService.setCurrentUser(null);
  }
}

